import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";
import Home from '../home/Home';
class RouterURL extends Component {
    render() {
        return (
            <div>
                <Route path="/home">
                    <Home />
                </Route>
            </div>
        );
    }
}

export default RouterURL;
